import ExpenseItem from "./components/ExpenseItem";

function App() {
    const expanses = [
        {
            id: 'e1',
            title: 'Car Insurance',
            amount: 265.97,
            date: new Date(2022, 3, 19)
        },
        {
            id: 'e2',
            title: 'Toilet Paper',
            amount: 10.27,
            date: new Date(2022, 3, 16)
        },
        {
            id: 'e3',
            title: 'Fruits',
            amount: 37.19,
            date: new Date(2022, 3, 15)
        },
        {
            id: 'e3',
            title: 'Table',
            amount: 76.90,
            date: new Date(2022, 3, 10)
        },
    ]
  return (
    <div>
      <h2>Let's get started!</h2>
        <ExpenseItem
            title={expanses[0].title}
            amount={expanses[0].amount}
            date={expanses[0].date}
        ></ExpenseItem>
        <ExpenseItem></ExpenseItem>
        <ExpenseItem></ExpenseItem>
        <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
